import React from 'react';
import './Move.css';

function Move(props) {
    return (
        <div className={`Move ${props.selected ? 'selected' : ''}`} onClick={() => props.selectMove(props.id)}>
            <span className="TurnId">#{props.id + 1}</span> <span className={`Side ${props.side}`}></span> {props.notation}
        </div>
    );
}

export default Move;
